DROP TABLE IF EXISTS  `world_safe_locs`;
CREATE TABLE `world_safe_locs` (
  `ID` int NOT NULL,
  `Map` int NOT NULL,
  `LocX` float NOT NULL,
  `LocY` float NOT NULL,
  `LocZ` float NOT NULL,
  `Facing` float NOT NULL,
  PRIMARY KEY (`ID`,`Map`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC;

